import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';
import { ReactiveFormsModule } from '@angular/forms';

import { AppComponent } from './app.component';
import { HomeComponent } from './home/home.component';
import { HeaderComponent } from './header/header.component';
import { BoardcontentComponent } from './boardcontent/boardcontent.component';
import { StatuslabelComponent } from './statuslabel/statuslabel.component';
import { SidebarComponent } from './sidebar/sidebar.component';
import { TaskListComponent } from './boardcontent/task-list/task-list.component';
import { AddTaskComponent } from './boardcontent/add-task/add-task.component';
import { TaskRoutingComponent } from './task-routing.component';

@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    HeaderComponent,
    BoardcontentComponent,
    StatuslabelComponent,
    SidebarComponent,
    TaskListComponent,
    AddTaskComponent,
    TaskRoutingComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      { path: '', component: HomeComponent, pathMatch: 'full' },
      { path: 'task', component: TaskListComponent},
      { path: 'task/:id/edit', component: AddTaskComponent},
    ]),
    ReactiveFormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
